DESCRIBE feedbacks;
-- 
-- Заполняем данными таблицу "Покупатели (клиенты)".
-- 
-- 
-- Обновить инфорамацмю в таблице "Покупатели (клиенты)", после вставки данных.
-- 
-- Заполняем время работы
UPDATE feedbacks SET time_work = 'from 09:00 to 18:00';
-- 
-- Обновляем дату создания записи
UPDATE feedbacks SET created_at=DATE_FORMAT(created_at,'2020-%m-%d %T');
-- 
-- Обновляем день рождения
UPDATE feedbacks SET birsday = DATE_FORMAT(birsday,'1997-%m-%d') WHERE YEAR(birsday) > 2010;
-- 
-- Обновляем поле Кому предназначено
UPDATE feedbacks SET recipient_id  = FLOOR(1 + RAND() * 12); -- FLOOR - отбросить дробную часть

UPDATE feedbacks SET user_id  = FLOOR(1 + RAND() * 150); -- FLOOR - отбросить дробную часть

SELECT * FROM feedbacks;


